import PropTypes from 'prop-types';
import classNames from 'classnames';

class Banner extends React.Component {
  render() {
    return (
      <div className='banner'>
        Success! We'll see your lovely selves soon.
        <style jsx>{`
          .banner {
            background-color: light(var(--color-green-light), 50%);
            color: var(--color-green-dark);
            padding: 8px 16px;
            border-radius: 4px;
            margin-top: 24px;
          }
        `}</style>
      </div>
    )
  }
}

export default Banner
